import React from 'react';
import Breadcrumb from '../components/Breadcrumb';

function UPS() {
  return (
    <div>
      <Breadcrumb />
      <h1>UPS Sayfası</h1><p>UPS ürünleri hakkında bilgiler.</p></div>
  );
}
export default UPS;
